import React from "react";

import "./DisplayInventory.css";

function DisplayInventory() {
  return (
    <div>
      <div className="inventroy">
        <div className="table">
            <table>
                <tr>
                    <th>Nilan</th>
                    <th>Nilan</th>
                    <th>Nilan</th>
                </tr>
            </table>
        </div>
      </div>
    </div>
  );
}

export default DisplayInventory;
